import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import IconButton from '@mui/material/IconButton';
import Input from '@mui/material/Input';
import FilledInput from '@mui/material/FilledInput';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import TextField from '@mui/material/TextField';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';

const Login = (props) => {
    const textFieldStyle = {width: {xs: "95%", sm: "95%", md: "60%"} , marginBottom: "25px"};
    const [userName, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [userNameError, setUsernameError] = useState("");
    
    function handleChange(e) {
        setUsername(e.target.value);
        // if (!userName) {
        //     setUsernameError("error");
        //     console.log("empty", userName);
        // }

        // console.log(userName);
    }

    return (
        <Box align="center">
            <FormGroup >
                {userName}
                <TextField  onChange={(e) => setUsername(e.target.value)} value={userName} sx={textFieldStyle} label="Username or email" required />
                <TextField  onChange={(e) => setPassword(e.target.value)} value={password} sx={textFieldStyle} label="Password" required />
                <FormControlLabel control={<Checkbox defaultChecked />} label="Remember me" />
            </FormGroup>



        </Box>
    )
}

export default Login
